import React from 'react';
import ReactDom from 'react-dom';
import add, { sub,div,multi} from './App';

ReactDom.render(

    <>
        <ol>
            <li>Sum of two Numbers {add(22,22)}</li>
            <li>sub of two Numbers {sub(30,3)}</li>
            <li>div of two Numbers {div(6.7,2)}</li>
            <li>multi of two Numbers {multi(9,10)}</li>
            
            </ol>
    </>,

     document.getElementById('root')

);
